package com.mbc.ontrip.hotel;

public class HotelInfo {
	private String 도시;
    private String 체크인;
    private String 체크아웃;
    private String 호텔명;
    private String 이미지;
    private String 가격;
    private String 링크;
	public HotelInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String get도시() {
		return 도시;
	}
	public void set도시(String 도시) {
		this.도시 = 도시;
	}
	public String get체크인() {
		return 체크인;
	}
	public void set체크인(String 체크인) {
		this.체크인 = 체크인;
	}
	public String get체크아웃() {
		return 체크아웃;
	}
	public void set체크아웃(String 체크아웃) {
		this.체크아웃 = 체크아웃;
	}
	public String get호텔명() {
		return 호텔명;
	}
	public void set호텔명(String 호텔명) {
		this.호텔명 = 호텔명;
	}
	public String get이미지() {
		return 이미지;
	}
	public void set이미지(String 이미지) {
		this.이미지 = 이미지;
	}
	public String get가격() {
		return 가격;
	}
	public void set가격(String 가격) {
		this.가격 = 가격;
	}
	public String get링크() {
		return 링크;
	}
	public void set링크(String 링크) {
		this.링크 = 링크;
	}

    
}
